  const numDrivers = 4;
  const [drivers, setDrivers] = useState([]);

  const passengers = [
    new Passenger(50, 60),
    new Passenger(20, 40),
    new Passenger(70, 50),
  ];

  console.log(passengers, "passengers");

  return (
    <div>
      {drivers}
      {/* <div> {passengers}</div> */}
